const mainId = [
    {
        id: 1,
        username :'testid',
        usericon : 'https://cdn.routefinders.co.kr/news/photo/202206/814_2576_4321.jpg',
        sampletodo : [
            "시간이 없어서",
            "최대한 맹글어 봤습니다.",
            "나머지 기능은 나중에 추가해보렵니다",
            "This is a sample todo-test4!",
            "This is a sample todo-test5!"],
    } 
];

export default mainId;
